import React, { useEffect, useState } from 'react';
import { API_URL, authHeader } from '../api';
import ConfirmModal from '../components/ConfirmModal';
import { getRole } from '../auth';

export default function Listings() {
  const [city, setCity] = useState('');
  const [listings, setListings] = useState([]);
  const [modalOpen, setModalOpen] = useState(false);
  const [selected, setSelected] = useState(null);
  const [msg, setMsg] = useState('');
  const role = getRole();

  const search = async () => {
    const res = await fetch(`${API_URL}/listings/search?city=${encodeURIComponent(city)}`, { headers: { ...authHeader() } });
    const data = await res.json().catch(() => []);
    setListings(Array.isArray(data) ? data : []);
  };

  useEffect(() => {
    search();
  }, []);

  const openClaim = (listing) => {
    setSelected(listing);
    setModalOpen(true);
  };

  const confirmClaim = async () => {
    if (!selected) return;
    const ngoId = localStorage.getItem('ngoId');
    if (!ngoId) {
      setMsg('Please create your NGO profile first (Profile page).');
      setModalOpen(false);
      return;
    }
    const res = await fetch(`${API_URL}/claims`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json', ...authHeader() },
      body: JSON.stringify({ listing_id: selected.id, ngo_id: Number(ngoId) })
    });
    const body = await res.json().catch(() => ({ detail: 'Failed' }));
    if (!res.ok) setMsg(body.detail || 'Claim failed');
    else setMsg('Claim successful');
    setModalOpen(false);
    search();
  };

  return (
    <div className="min-h-screen p-6" style={{ backgroundColor: '#F9F3EF' }}>
      <div className="flex flex-col gap-4 mb-6 sm:flex-row sm:items-end">
        <div className="form-control">
          <label className="label">
            <span className="label-text text-[#555879] font-semibold">City</span>
          </label>
          <input
            className="input input-bordered w-full rounded-lg border-[#98A1BC] focus:border-[#555879] focus:ring-1 focus:ring-[#555879] transition-colors duration-200"
            placeholder="e.g., Johannesburg"
            value={city}
            onChange={(e) => setCity(e.target.value)}
          />
        </div>
        <button className="btn btn-primary bg-[#555879] hover:bg-[#98A1BC] border-none text-white hover:text-[#555879] transition-colors duration-200" onClick={search}>
          <svg xmlns="http://www.w3.org/2000/svg" className="w-5 h-5" fill="none" viewBox="0 0 24 24" stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" /></svg>
          Search
        </button>
      </div>

      {msg && (
        <div className={`alert rounded-lg mt-4 ${msg.includes('successful') ? 'alert-success' : 'alert-error'} text-sm`}>
          <span className='font-medium'>{msg}</span>
        </div>
      )}

      <div className="grid grid-cols-1 gap-6 md:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4">
        {listings.map((l) => (
          <div key={l.id} className="card bg-white shadow-lg rounded-xl transition-transform transform hover:scale-105 border-2 border-[#98A1BC]">
            <div className="p-6 card-body">
              <h2 className="card-title text-xl font-bold text-[#555879]">{l.title}</h2>
              <p className="my-2 text-gray-600">{l.description}</p>
              <div className="text-sm font-medium text-gray-500">
                <p>Quantity: **{l.quantity} {l.unit}**</p>
                <p>City: **{l.city}**</p>
                <p>Status: **{l.status}**</p>
              </div>
              <div className="justify-end mt-4 card-actions">
                {role === 'ngo' && l.status === 'OPEN' && (
                  <button className="btn btn-success bg-[#98A1BC] hover:bg-[#555879] border-none text-[#555879] hover:text-white transition-colors duration-200" onClick={() => openClaim(l)}>
                    <svg xmlns="http://www.w3.org/2000/svg" className="w-5 h-5" fill="none" viewBox="0 0 24 24" stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M5 13l4 4L19 7" /></svg>
                    Claim
                  </button>
                )}
              </div>
            </div>
          </div>
        ))}
      </div>

      <ConfirmModal
        open={modalOpen}
        title="Confirm Claim"
        message={`Are you sure you want to claim "${selected?.title}"?`}
        onConfirm={confirmClaim}
        onCancel={() => setModalOpen(false)}
      />
    </div>
  );
}
